# https://www.hackerrank.com/challenges/angry-children/problem

def maxMin(k, arr):
    arr.sort()
    # print('k:', k)
    # print('sorted arr:', arr)
    diffs = []
    for i in range(1, len(arr)):
        diffs.append(arr[i] - arr[i - 1])
    # print('diffs:', diffs)
    start = 0
    end = k - 1
    min_unfairness = float('inf')
    unfairness = None
    while end <= len(diffs):
        arr_prime_diffs = diffs[start:end]
        if unfairness is None:
            unfairness = sum(arr_prime_diffs)
        else:
            unfairness += diffs[end - 1]
            unfairness -= diffs[start - 1]
        # print(start, end, arr_prime_diffs, unfairness)
        if unfairness < min_unfairness:
            min_unfairness = unfairness
        start += 1
        end += 1
    return min_unfairness


